cts.It was founded in 2013, by Urška Sršen and Sando Mur.The company focuses on designing technology that informs and inspires women around the world. Their products Collect data on activity, sleep, stress, and reproductive health that helps to empower women with knowledge about their own health and habits."]},{"cell_type":"markdown","id":"18bf5733","metadata":{"papermill":{"duration":0.005956,"end_time":"2023-02-23T18:48:37.751043","exception":false,"start_time":"2023-02-23T18:48:37.745087","status":"completed"},"tags":[]},"source":["# <center> Objective</center>\n","\n","To study smart device users’ daily habits.\n","For this purpose a public dataset, <span style=\"color:red;\">FitBit Fitness Tracker Data</span> (CC0: Public Domain, dataset made available through Mobius), is used.\n","This Kaggle data set contains personal fitness tracker from thirty fitbit users.\n","\n","\n","In this project, R programming language is used for analysis and visualization."]},{"cell_type":"markdown","id":"c6607482","metadata":{"papermill":{"duration":0.005906,"end_time":"2023-02-23T18:48:37.762844","exception":false,"start_time":"2023-02-23T18:48:37.756938","status":"completed"},"tags":[]},"source":["***"]},{"cell_type":"markdown","id":"5eaa98e4","metadata":{"papermill":{"duration":0.005963,"end_time":"2023-02-23T18:48:37.774715","exception":false,"start_time":"2023-02-23T18:48:37.768752","status":"completed"},"tags":[]},"source":["# <center>Processing and preparing data</center>\n","\n","## Installing and loading Packages"]},{"cell_type":"code","execution_count":1,"id":"2b50c57e","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-02-23T18:48:37.791812Z","iopub.status.busy":"2023-02-23T18:48:37.789098Z","iopub.status.idle":"2023-02-23T18:55:56.350073Z","shell.execute_reply":"2023-02-23T18:55:56.348186Z"},"papermill":{"duration":438.573817,"end_time":"2023-02-23T18:55:56.354425","exception":false,"start_time":"2023-02-23T18:48:37.780608","status":"completed