and Thursday is the least active day.\n","\n","6. Bellabeat devices, like <span style=\"color:red;\">Time</span> and <span style=\"color:red;\">Leaf</span>, can help encourage customers to be more active. By reminding them to get up and move around or do some light exercise if they have been sitting for a long period.\n","\n","7.  These devices can help the customers trace the number of steps they have taken and improve it by setting small targets for themselves\n","\n","8. Customers can also use these devices to improve their sleep schedule\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":447.340687,"end_time":"2023-02-23T18:56:01.41529","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-02-23T18:48:34.074603","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}